import React from 'react';
import Stagiaire from './Stagiaire';
import { Link } from 'react-router-dom';

const ListStagiaire = (props) => {
    const img = "imgs prjt/"+props.image;
    return (
        <>
            <main className="container"> 
                <h1>List Des Stagiaires </h1> 
                 <Link to="/StagiaireAjouter"> <button type='button'> Ajouter Stagiaire</button></Link>
                <div className="row mb-2">
                {
                     props.listStg.map((e)=>
                        
                     <div className="col"> 
                     <div className="card shadow-sm"> 
                         <img className="bd-placeholder-img card-img-top" 
                         src={img} alt="photo" /> 
                         <div className="card-body">
                             <p className="card-text"key={props} > id : {props.key}</p> 
                             <p className="card-title"> Nom et Prenom : {props.prenom} {props.nom} </p> 
                             <p className="card-text"> Email : {props.email}</p> 
                             <div className="d-flex justify-content-between align- 
                             items-center"> 
                                 <div className="btn-group"> 
                                <Link to={`/StagiaireModifier/${props.id}`}> <button type="button" className="btn btn1 btn-sm btn- 
                                     outline-secondary"> Modifier </button> </Link>
                                  <Link to={`/StagiaireSupprimer/${props.id}`}><button type="button" className="btn btn1 btn-sm btn- 
                                     outline-secondary">Supprimer</button> </Link>
                                 </div> 
                             </div> 
                         </div> 
                     </div> 
                 </div>
                )}
                </div> 
            </main> 
        </>
    );
}

export default ListStagiaire;
